import React from 'react';
import { NavLink } from 'react-router-dom';
import Contact from './Contact';
import About from './About';


export const Home = () => {
    return (
        <>
          
          <h1>I'm Home</h1>  
          <a href='/src/ReactRouter/About.jsx'>{About}</a>
          <a href='/src/ReactRouter/Contact.jsx'>{Contact}</a>
        </ >
       
    )
}

export default Home;
